tables.table_schema:
CREATE TABLE Users (
    user_id INT,
    username VARCHAR(50),
    age INT,
    gender VARCHAR(10)
);

CREATE TABLE Orders (
    order_id INT,
    user_id INT,
    product_name VARCHAR(100),
    quantity INT,
    price DECIMAL(10,2)
);

CREATE TABLE users (
    user_id INT PRIMARY KEY,
    username VARCHAR(50),
    age INT,
    gender VARCHAR(10)
);

CREATE TABLE users (
    user_id INT PRIMARY KEY,
    username VARCHAR(255),
    email VARCHAR(255),
    age INT
);

CREATE TABLE orders (
    order_id INT PRIMARY KEY,
    user_id INT,
    order_date DATE,
    total_amount DECIMAL(10, 2)
);

CREATE TABLE products (
    product_id INT PRIMARY KEY,
    product_name VARCHAR(255),
    category VARCHAR(50),
    price DECIMAL(8, 2)
);

CREATE TABLE order_items (
    order_id INT,
    product_id INT,
    quantity INT,
    PRIMARY KEY (order_id, product_id)
);

CREATE TABLE user_preferences (
    user_id INT,
    preference VARCHAR(50),
    rating FLOAT,
    PRIMARY KEY (user_id, preference)
);
